import "./Navbar.css";

import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
			<ul>
				<li>
					<Link to="/our_story">Our Story</Link>
				</li>
				<li>
					<a href="/experience">The experience</a>
				</li>
				<li>
					<a href="/rsvp">RSVP</a>
				</li>
			</ul>
    </nav>
  )
}

export default Navbar
